 independent entities with their own memory space, while threads share the same memory space","Processes are lightweight and share resources, while threads are heavyweight and have their own resources","Processes are used for multitasking, while threads are used for multithreading","Processes are created using the fork() system call, while threads are created using the pthread_create() function"],answer:"Processes are independent entities with their own memory space, while threads share the same memory space",tag:["Process","Thread","Operating System"]},{questionText:"In a relational database, what is the purpose of a foreign key constraint?",options:["To ensure that the data in a table is unique","To define a relationship between two tables by referencing a primary key in another table","To enforce data integrity by preventing the insertion of duplicate values","To optimize query performance by creating indexes on frequently accessed columns"],answer:"To define a relationship between two tables by referencing a primary key in another table",tag:["Relational Database","Foreign Key","Data Integrity"]},{questionText:"What is the difference between a static variable and a dynamic variable in programming?",options:["Static variables are declared within a function, while dynamic variables are declared outside a function","Static variables have a fixed memory address, while dynamic variables have a memory address that can change","Static variables are allocated on the stack, while dynamic variables are allocated on the heap","Static variables retain their value between function calls, while dynamic variables do not"],answer:"Static variables retain their value between function calls, while dynamic variables do not",tag:["Static Variable","Dynamic Variable","Variable Scope"]},{questionText:"What is the purpose of a mutex in multithreaded programming?",options:["To ensure that only one thread can access a shared resource at a time","To allow multiple threads to access a sha ","BFS","Search Algorithms"]},{questionText:"What is the difference between a compile-time error and a runtime error?",options:["Compile-time errors occur during the compilation process, while runtime errors occur during the execution of the program","Compile-time errors are caused by syntax errors, while runtime errors are caused by logical errors","Compile-time errors can be fixed by modifying the source code, while runtime errors can only be fixed by debugging the program","Compile-time errors are typically easier to identify and fix than runtime errors"],answer:"Compile-time errors occur during the compilation process, while runtime errors occur during the execution of the program",tag:["Compile-time Error","Runtime Error","Programming Errors"]},{questionText:"What is the purpose of a cache in a computer system?",options:["To store frequently used data for faster access","To manage the allocation of memory for different processes","To implement a file system for organizing and accessing files","To protect the system from unauthorized access"],answer:"To store frequently used data for faster access",tag:["Cache","Computer System","Performance Optimization"]},{questionText:"What is the difference between a synchronous and an asynchronous operation in programming?",options:["Synchronous operations block the execution of the program until they are completed, while asynchronous operations do not","Synchronous operations are typically faster than asynchronous operations, but they can block the program","Synchronous operations are used for I/O operations, while asynchronous operations are used for CPU-bound tasks","Synchronous operations are implemented using threads, while asynchronous operations are implemented using events"],answer:"Synchronous operations block the execution of the program until they are completed, while asynchronous operations do not",tag:["Synchronous Operation","Asynchronous Operation","Concurrency"]},{questionText:"What is the difference between
